<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">
<html xmlns="http://www.w3.org/1999/xhtml"
	xmlns:v="urn:schemas-microsoft-com:vml">
	<head>
		<title>stroke_properties.html</title>
		<meta http-equiv="content-type" content="text/html; charset=UTF-8" />
		<?import namespace="v" implementation="#default#VML" ?>
		<style>
</style>
	</head>
	<body>
		<v:curve style="z-index:1;LEFT:249px;POSITION:absolute;TOP:144px"
			from="0,0" control1="32.25,-15" control2="24.75,24" to="70.5,0"
			filled="f" fillcolor="white" stroked="t" strokecolor="#e725d6"
			strokeweight=".75">
			<v:stroke opacity="1" startarrow="none" startarrowwidth="narrow"
				startarrowlength="short" endarrow="classic" endarrowwidth="wide"
				endarrowlength="long" />
		</v:curve>
		<v:curve style="z-index:1;LEFT:251px;POSITION:absolute;TOP:187px"
			from="0,0" control1="32.25,-15" control2="24.75,24" to="70.5,0"
			filled="f" fillcolor="white" stroked="t" strokecolor="#e725d6"
			strokeweight=".75">
			<v:stroke opacity="1" startarrow="none" startarrowwidth="narrow"
				startarrowlength="short" endarrow="classic" endarrowwidth="wide"
				endarrowlength="long" dashstyle="dash" />
		</v:curve>
		<v:rect
			style="z-index:1;LEFT:248px;WIDTH:69px;POSITION:absolute;TOP:222px;HEIGHT:51px"
			fillcolor="white" stroked="t" strokecolor="#e725d6"
			strokeweight=".75">
			<v:stroke opacity="1" dashstyle="dot" />
		</v:rect>
		<v:rect
			style="z-index:1;LEFT:325px;WIDTH:69px;POSITION:absolute;TOP:223px;HEIGHT:51px"
			fillcolor="white" stroked="t" strokecolor="#e725d6"
			strokeweight=".75">
			<v:stroke opacity="1" dashstyle="dash" />
		</v:rect>
		<v:rect
			style="z-index:1;LEFT:402px;WIDTH:69px;POSITION:absolute;TOP:223px;HEIGHT:51px"
			fillcolor="white" stroked="t" strokecolor="#e725d6"
			strokeweight=".75">
			<v:stroke opacity="1" dashstyle="longDashDotDot" />
		</v:rect>
		<v:oval
			style="z-index:1;LEFT:244px;WIDTH:61px;POSITION:absolute;TOP:292px;HEIGHT:58px"
			fillcolor="white" stroked="t" strokecolor="#e725d6"
			strokeweight="2.25">
			<v:stroke opacity="1" dashstyle="shortDashDot" />
		</v:oval>
	</body>
